<!doctype html>
<html lang="en">
  <head>
    <meta charset="UTF-8">
    <style>
      html, body {
        padding: 0;
        margin: 0;
        height: 100%;
        border: none;
        -webkit-text-size-adjust: 100%;
        font-family: Helvetica, sans-serif;
      }
      
      #loading {
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        width: 100%;
        height: 100%;
        display: -webkit-box;
        display: -ms-flexbox;
        display: flex;
        -webkit-box-pack: center;
        -ms-flex-pack: center;
        justify-content: center;
      }
      
      .wrapper {
        position: relative;
        top: 20%;
        width: 10vw;
        height: 10vw;
        display: -webkit-box;
        display: -ms-flexbox;
        display: flex;
        -webkit-box-orient: vertical;
        -webkit-box-direction: normal;
        -ms-flex-direction: column;
        flex-direction: column;
        -webkit-box-align: center;
        -ms-flex-align: center;
        align-items: center;
      }
      
      .logo > svg {
        width: 100%;
        height: 100%;
      }
      
      #stage {
        font-size: 16px;
        margin-top: 20px;
      }
    </style>

 should be invoked after view rendering but before placing to destination place in DOM\n- `tooltip` – setup a tooltip to show on view hovering, can be applied for views with a container only\n\nThe order of evaluation during a view render:\n\n```js\n                          input data | output data (the result of \"data\" evaluation if any)\n                                     |\nrender start ---\x3e [when] --\x3e [data] -|-> [whenData] --\x3e [postRender] --\x3e [className] --\x3e render finish\n                                     |\n```\n\nWhen `data` property is specified, it changes flow's data according the following rules:\n\n- a string – treated as a query which result is used as the output data\n- a function like `fn(data, context)` – the result of the function invocation is used as the output data\n- any other value used as the output data\n\n> Note: Only `when` and `data` properties get an input data, any other functions and queries receive\na result of `data` property evalution. When `data` is not specified all the queries and functions\nreceive the same input data.\n\nProperties `when` and `whenData` can take:\n\n- a string – treated as a query\n- `true` – treated as a empty query which mean that the data itself is examinated with no any transformation\n- `undefined` – same when not specified, just render (ignore the property)\n- a function like `fn(data, context)`\n- any other value used as is\n\nRegardless of how the value is obtained, it is coerce to a boolean.\nPlase note, that Jora rules are used which mean that empty arrays and object with no own keys are falsy (truthy in JavaScript).\nThe view is only rendered if the resulting value is truthy.\n\n## Queries for properties\n\nIn some cases, it is necessary to compute the value of a property based on the data.\nTo do this, you can use a string value for a property that starts with `=`.\nThis will mean that everything after the `=` is a query which will take output data and produce a value for the       setStage('Parsing', () => {
        for (const element of document.querySelectorAll('script')) {
          if(element.dataset.id) {
            jsonExtAPIName.pushChunk(element.dataset.id, element.innerText);
            // cleanup script-tags to free memory
            element.remove();
          }
        }
        
        const initFunction = function (data) {
            Statoscope.default(data.map((item) => ({ name: item.id, data: item.data })));
          };
        
        jsonExtAPIName.parse()
          .then(items => {
            setStage('Initialization', () => {
              initFunction(items);
              document.querySelector('#loading').remove();
            });
          });
      })
    </script>
  </body>
</html>
